message:
Ministério Minas e Energia anuncia mais uma herança bendita: redução de 38,9% na tarifa de Itaipu para 2023. Com isso haverá redução de mais de R$ 9 bilhões nos custos da energia elétrica paga pelos consumidores. Energia limpa, segura e barata beneficiando o consumidor brasileiro.
Adolfo Sachsida
@GeFazioBreakingNews 🇺🇸🇧🇷

BOLETIM DO DOU🇧🇷
DIÁRIO OFICIAL DA UNIÃO 
BRASILIA 20/12/2022 - DECRETO DE 19 DE DEZEMBRO DE 2022

OPRESIDENTE DA REPÚBLICA, no uso da atribuição que lhe confere o art. 84,caput, inciso XXV, da Constituição, e tendo em vista o disposto na Lei nº 11.440, de 29 de dezembro de 2006, resolve:

